function TempVsTime(a){var e=[];for(graphData=JSON.parse(a),i=0;i<graphData.sensor.length;i++){var t=[],r=[];for(j=0;j<graphData.size;j++)graphData.sensor[i][j][1]<160&&(r.push(graphData.sensor[i][j][0]),t.push(graphData.sensor[i][j][1]));var s={y:t,x:r,marker:{size:12},mode:"lines",type:"scatter",name:graphData.text[i]};e.push(s)}var o={yaxis:{showgrid:!1,title:"Temperature"},xaxis:{showgrid:!1,title:"Time"},title:"Temperature VS Time"};Plotly.newPlot("tempVsTimePlot",e,o)}function avgTemp(a){dbJSON=JSON.parse(a);var e=[];for(i=0;i<dbJSON.size.length;i++){var t={y:[dbJSON.avgTemp[i],dbJSON.errMax[i],dbJSON.errMin[i]],type:"box",name:dbJSON.avgChan[i]};e.push(t)}var r={title:"Average Temperature"};Plotly.newPlot("avgTempPlot",e,r)}function sheetContour(a){graphData=JSON.parse(a);var e=[{x:graphData.x,y:graphData.y,z:graphData.z,type:"contour"}],t={title:"Contour"};Plotly.newPlot("contourPlot",e,t)}function sheetMesh(a){graphData=JSON.parse(a);var e=[{x:graphData.x,y:graphData.y,z:graphData.z,type:"mesh3d",opacity:.8,color:"rgb(171,154,164)"}],t={title:"Mesh"};Plotly.newPlot("meshPlot",e,t)}function thickVsDate(a){graphData=JSON.parse(a);var e={xaxis:{showgrid:!1},title:"Sheet Thickness Vs Date"},t=[{x:graphData.x3,y:graphData.y3,text:graphData.name3,name:"3 Ply",marker:{size:12,color:"red"},mode:"markers",type:"scatter"},{x:graphData.x8,y:graphData.y8,text:graphData.name8,name:"8 Ply",marker:{size:12,color:"blue"},mode:"markers",type:"scatter"}];Plotly.newPlot("thicknessPlot",t,e)}function massVsDate(a){graphData=JSON.parse(a);var e={xaxis:{showgrid:!1},title:"Sheet Mass VS Date"},t=[{x:graphData.x3,y:graphData.y3,text:graphData.name3,name:"3 Ply",marker:{size:12,color:"red"},mode:"markers",type:"scatter"},{x:graphData.x8,y:graphData.y8,text:graphData.name8,name:"8 Ply",marker:{size:12,color:"blue"},mode:"markers",type:"scatter"}];Plotly.newPlot("massPlot",t,e)}